import SelectGov from 'component-library-gov/Select';

export default function Select() {
  return (
    <>
      <form action="">
        <fieldset>
          <SelectGov size="tiny" name="test">
            <option value="asdf">ASDF</option>
          </SelectGov>
        </fieldset>
        <fieldset>
          <SelectGov size="tiny" name="test" />
        </fieldset>
      </form>
    </>
  );
}
